column8:
ES-20専用センターキャップ。<BR>
ブラック/ブラック(画像1枚目左)と、アルマイトバフ/レッド(画像1枚目右)の2色のラインナップ。<BR>
画像2枚目はES-20ブラックポリッシュにセンターキャップ・ブラックの組み合わせ。<BR>
4WDには装着不可。
<hr>
【適合車名】ハイエース/レジアスエース/キャラバン<br>
【適合ホイール】ESSEX ES-20<BR>
【入数】1台分(4個入)<BR>
【ブランド】ESSEX/エセックス<hr>
【カラー】<br>
ブラック/ブラックオーナメント　\12,600-<BR>
バフアルマイト/レッドオーナメント　\12,600-
<hr>
<font color="#ff0000"><b>【必ずお読みください】</b></font><br>
※『1万円以上送料無料』対象外商品です。<br>
※別商品との同梱はできません。<br>
※メーカーからの直送商品です。<br>
※代引きはお受けすることが出来ません。<br>
※お急ぎの方はご注文前に納期お問い合わせ下さい。<br>
※北海道・沖縄・離島の場合は送料着払いにてご対応させて頂きます。<BR><br>







